import axios from 'axios';

const url = "https://specifications.vinaudit.com/v3/selections?key=9NSOAST0U19Z4HH&list=";

export function getVehicleModels(make) {
    return dispatch => {
        axios.get(url + `year=${year}make=${make}&format=json`).then(res => {
            dispatch({
                type: 'GET_VEHICLE_MODELS',
                models: res.data.selections
            })
        }).catch(err => {
            console.log(err)
        })
    }
}

export default function reducer(models = [], action) {
    switch(action.type) {
        case "GET_VEHICLE_MODELS":
            return action.models
        default: 
            return models
    }
}
